const someCommonValues = ['common', 'values'];

export const clearUserAuthToken = () => {
    window.sessionStorage.setItem('auth_token', '');
};

export const checkUserLoggedIn = () => {    
    if(window.sessionStorage.getItem('auth_token') != ''){
        return true;
    } else {
        return false;
    }
};
